import React from 'react';
import './Hero.css';

const Hero = ({ scrollToContent }) => {
  return (
    <section className="hero">
      <img src={require('../assets/simarMain1.JPG')} alt="Background" className="hero-image" />
      <div className="overlay">
        <h1 className="">Hello, I am Simar!</h1>
        <p>B.S. Computer Science | Software Engineer</p>
        <button className="btn" onClick={scrollToContent}>Discover More</button>
      </div>
    </section>
  );
};

export default Hero;
